import React, { useState } from 'react';
import { questions, quizResultDescriptions } from './data';
import { useNavigate } from 'react-router-dom';
import './App.css';

const QuizPage = () => {
  const navigate = useNavigate();
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  // 假设每题只允许单选（answers 保存题目 id 对应的选项索引）
  const [answers, setAnswers] = useState({});
  const [result, setResult] = useState(null);

  const handleOptionClick = (questionId, optionIndex) => {
    setAnswers({ ...answers, [questionId]: optionIndex });
  };

  const goToNextQuestion = () => {
    if (currentQuestionIndex < questions.length - 1) {
      setCurrentQuestionIndex(currentQuestionIndex + 1);
    }
  };

  const goToPreviousQuestion = () => {
    if (currentQuestionIndex > 0) {
      setCurrentQuestionIndex(currentQuestionIndex - 1);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // 检查是否所有题目均已回答
    for (let i = 0; i < questions.length; i++) {
      if (answers[questions[i].id] === undefined) {
        alert(`Please select an option for question ${i + 1}`);
        return;
      }
    }
    // 计算得分（示例代码，与原逻辑类似）
    const scores = {
      Squirrel: 0,
      Penguin: 0,
      Owl: 0,
      Fox: 0,
      Raccoon: 0,
      Cheetah: 0,
      'Golden Retriever': 0,
      Capybara: 0,
    };

    questions.forEach((question) => {
      const selectedIndex = answers[question.id];
      if (selectedIndex !== undefined) {
        const selectedOption = question.options[selectedIndex];
        for (let animal in selectedOption.score) {
          scores[animal] += selectedOption.score[animal];
        }
      }
    });

    let finalAnimal = null;
    let highestScore = -Infinity;
    Object.keys(scores).forEach((animal) => {
      if (scores[animal] > highestScore) {
        highestScore = scores[animal];
        finalAnimal = animal;
      }
    });

    const finalResult = quizResultDescriptions[finalAnimal];
    setResult(finalResult);
  };

  const currentQuestion = questions[currentQuestionIndex];

  // 预设题目总数，用于进度条（假设 questions.length 为 7，与示例对应）
  const totalQuestions = questions.length;
  // 为进度指示圈设定各自的 left 值（根据示例）
  const leftPositions = ['120px', '285px', '446px', '607px', '768px', '929px', '1090px'];

  return (
    <div style={{ width: '1280px', height: '850px', position: 'relative', background: '#0057FF' }}>
      {/* 内容区域下移 100px 给 Navbar 留空间 */}
      <div style={{ position: 'absolute', top: '100px', width: '100%', height: '750px' }}>
        {/* 问题标题 */}
        <div
          style={{
            width: '908px',
            height: '99px',
            left: '243px',
            top: '128px',
            position: 'absolute',
            color: 'white',
            fontSize: '32px',
            fontFamily: 'Red Rose',
            fontWeight: 700,
            wordWrap: 'break-word'
          }}
        >
          {currentQuestion.question}
        </div>
        {/* 题号容器 */}
        <div style={{ width: '98px', height: '100px', left: '120px', top: '128px', position: 'absolute' }}>
          <div
            style={{
              width: '92px',
              height: '92px',
              left: '6px',
              top: '8px',
              position: 'absolute',
              background: 'black',
              borderRadius: '9999px'
            }}
          ></div>
          <div
            style={{
              width: '92px',
              height: '92px',
              left: '0px',
              top: '0px',
              position: 'absolute',
              background: '#FED702',
              borderRadius: '9999px',
              border: '10px solid black'
            }}
          ></div>
          <div
            style={{
              width: '65px',
              height: '68px',
              left: '13px',
              top: '12px',
              position: 'absolute',
              textAlign: 'center',
              color: 'black',
              fontSize: '32px',
              fontFamily: 'RL Aqva',
              fontWeight: 900,
              wordWrap: 'break-word'
            }}
          >
            #{currentQuestionIndex + 1}
          </div>
        </div>
        {/* 选项，假设每题有 4 个选项，按 2x2 网格排列 */}
        {currentQuestion.options.map((option, index) => {
          let left, top;
          if (index === 0) { left = '120px'; top = '256px'; }
          else if (index === 1) { left = '120px'; top = '397px'; }
          else if (index === 2) { left = '664px'; top = '256px'; }
          else if (index === 3) { left = '664px'; top = '397px'; }
          return (
            <div
              key={index}
              onClick={() => handleOptionClick(currentQuestion.id, index)}
              style={{
                width: '496px',
                height: '111px',
                left,
                top,
                position: 'absolute',
                cursor: 'pointer',
                // 高亮选中项（这里简单以边框颜色区分）
                border: answers[currentQuestion.id] === index ? '10px solid red' : '10px solid black'
              }}
            >
              <div
                style={{
                  width: '496px',
                  height: '111px',
                  left: '0px',
                  top: '0px',
                  position: 'absolute',
                  background: 'white',
                  borderRadius: '30px',
                  border: '10px solid black'
                }}
              ></div>
              <div
                style={{
                  width: '418px',
                  height: '52.52px',
                  left: '39px',
                  top: '29.84px',
                  position: 'absolute',
                  textAlign: 'center',
                  color: 'black',
                  fontSize: '20px',
                  fontFamily: 'Red Rose',
                  fontWeight: 700,
                  wordWrap: 'break-word'
                }}
              >
                {option.option}
              </div>
            </div>
          );
        })}
        {/* 导航按钮区 */}
        <div
          style={{
            width: '231px',
            height: '69.75px',
            left: '120px',
            top: '536px',
            position: 'absolute',
            cursor: 'pointer'
          }}
          onClick={goToPreviousQuestion}
        >
          <div
            style={{
              width: '231px',
              height: '69.75px',
              left: '0px',
              top: '0px',
              position: 'absolute',
              background: '#E681FF',
              borderRadius: '34.88px',
              border: '7.50px solid black'
            }}
          ></div>
          <div
            style={{
              width: '117px',
              height: '33px',
              left: '57px',
              top: '18.75px',
              position: 'absolute',
              textAlign: 'center',
              color: 'black',
              fontSize: '30px',
              fontFamily: 'RL Aqva',
              fontWeight: 900,
              wordWrap: 'break-word'
            }}
          >
            Back
          </div>
        </div>
        {currentQuestionIndex < totalQuestions - 1 ? (
          <div
            style={{
              width: '231px',
              height: '69.75px',
              left: '929px',
              top: '537px',
              position: 'absolute',
              cursor: 'pointer'
            }}
            onClick={goToNextQuestion}
          >
            <div
              style={{
                width: '231px',
                height: '69.75px',
                left: '0px',
                top: '0px',
                position: 'absolute',
                background: '#81ECFF',
                borderRadius: '34.88px',
                border: '10px solid black'
              }}
            ></div>
            <div
              style={{
                width: '117px',
                height: '33px',
                left: '57px',
                top: '18.75px',
                position: 'absolute',
                textAlign: 'center',
                color: 'black',
                fontSize: '30px',
                fontFamily: 'RL Aqva',
                fontWeight: 900,
                wordWrap: 'break-word'
              }}
            >
              Next
            </div>
          </div>
        ) : (
          <div
            style={{
              width: '231px',
              height: '69.75px',
              left: '929px',
              top: '537px',
              position: 'absolute',
              cursor: 'pointer'
            }}
            onClick={handleSubmit}
          >
            <div
              style={{
                width: '231px',
                height: '69.75px',
                left: '0px',
                top: '0px',
                position: 'absolute',
                background: '#81ECFF',
                borderRadius: '34.88px',
                border: '10px solid black'
              }}
            ></div>
            <div
              style={{
                width: '117px',
                height: '33px',
                left: '57px',
                top: '18.75px',
                position: 'absolute',
                textAlign: 'center',
                color: 'black',
                fontSize: '30px',
                fontFamily: 'RL Aqva',
                fontWeight: 900,
                wordWrap: 'break-word'
              }}
            >
              Submit
            </div>
          </div>
        )}
        {/* 进度条：SVG 横线 */}
        <div style={{ position: 'absolute', left: '156.50px', top: '689.50px' }}>
          <svg width="970" height="11" viewBox="0 0 970 11" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M0.5 5.5H969.5" stroke="black" strokeWidth="10" />
          </svg>
        </div>
        {/* 进度指示器 */}
        {questions.map((q, idx) => {
          // 根据示例中各圈的位置
          let background, border;
          if (idx === currentQuestionIndex) {
            background = 'black';
            border = '10px solid #FED702';
          } else {
            background = '#0057FF';
            border = '10px solid black';
          }
          return (
